import {
  IonButton,
  IonButtons,
  IonContent,
  IonPage,
  IonToolbar,
} from "@ionic/react";
import React from "react";

const SignUp: React.FC = () => {
  return (
    <IonPage>
      <IonContent>
        <IonToolbar>
          <IonButtons>
            <IonButton href="/signIn"> To Sign In</IonButton>
          </IonButtons>
        </IonToolbar>
      </IonContent>
    </IonPage>
  );
};

export default SignUp;
